import React from 'react'
import blogimage from '../images/photo-14.jpg';

function BlogImage() {
    return (
        <div class="blog-signle-img" data-aos="fade-in" data-aos-duration="500">
            <img src={BlogImage} alt="" />
        </div>
    )
}

export default BlogImage
